import React, { Component } from "react";
import { Container } from "react-bootstrap";
import { NavLink } from "react-bootstrap";
import "./Menu.css";
class Menu extends Component {
  render() {
    return (
      <>
        <Container>
          <ul className="super-links">
            <NavLink to="" className="super">
              MOBILE PHONE
            </NavLink>
            <NavLink to="">LAPTOPS & DESKTOP</NavLink>
            <NavLink to="">TVS & PROJECTORS</NavLink>
            <NavLink to="">ACCESSORIES</NavLink>
            <NavLink to="">PRINTER</NavLink>
            <NavLink to="">SPEAKERS</NavLink>
            <NavLink to="">FASHION</NavLink>
            <NavLink to="">Baby Product</NavLink>
          </ul>
        </Container>
      </>
    );
  }
}

export default Menu;
